:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Marianne and DAVIES, Christopher Pearson
  JDAVIES, Christopher Pearson and WILLIAMS, Mary Anne
  JDAVIES, Ereda Lilian and DODGSHUN, Gordon Mawley
  JDODGSHUN, Sydney Yorke and WOODWARD, Dorothy Virginia
  DODGSHUN, Sydney Yorke and WOODWARD, Dorothy Virginia (cont...)
  Dorothy was educated at Waikato Diocesan School for Girls. An outdoor person, she had her own team of
  dogs and helped on the farm. She has been a keen horsewoman and dressage rider for many years and rode
  in the Samsung International Prix St George Dressage Competition at Taupo in 1990. Now retired from
  competition, she has taken up judging.
  Rauweka
  In 1954 Sydney Yorke Dodgshun purchased a 254 hectare part of "Pakowhai" station, the Black family
  property at Muriwai, south of Gisborne, and named it "Rauweka". Since his retirement the property has
  been bought and farmed by his son, Paul Sydney Dodgshun.
  01> DODGSHUN, Wendy Elizabeth m on 14.03.1970 to WILLOCK, Michael John
  b 13.02.1949
  b 16.03.1947
  Wendy b, at Gisborne and m, at Toko Toru Tapu Church, Manutuke, Gisborne. Michael, s/o John Seymour
  Willock (b. at Gisborne, educated at Wanganui Collegiate School) and Jean Emily Beedie (b. at
  Dannevirke and educated at Nga Tawa College). Address: Wharehau Station, RD 3, Whangara, Gisborne.
  Wendy was educated at Woodford House and Michael was educated at Wanganui Collegiate School. They
  are now farming in partnership.
  01> WILLOCK, Joanna Mary m on 14.12.1996 to BROAD, Michael Lowther
  (Janna)
  b 21.04.1972
  b 23.01.1969
  Joanna b. at Gisborne and m. at Wharehau, Gisborne. Michael, slo Daniel Lowther Broad and Mary
  Busby, b, at Gisborne. Address: 137 Lytton Road, Gisborne.
  Janna was educated at Woodford House and graduated DipTchng and BEd from Teacher's Training
  College, Palmerston North in 1994. She is currently teaching at Ormond Primary School,
  Gisborne.
  Michael was educated at Huntley School in Marton and Rathkeale College, Masterton and graduated
  from Massey University, Palmerston North with a Diploma in Wool and a Certificate in
  Horticultural Practices. He was a wool buyer for Des Davies Ltd for three years and is
  presently employed in Horticulture and Viticulture in Gisborne.
  02> WILLOCK, Andrew Seymour
  b 16.05.1974
  Andrew b. at Gisborne and educated at Hereworth School and Wanganui Collegiate School. He was
  a member of the New Zealand Secondary Schools rugby team in 1992 and played representative
  rugby for Poverty Bay in 1993, 1994 and 1996. He worked on the family farm when in Gisborne
  and spent six months on a working holiday in England in 1995. In 1997 he worked for an office
  sales equipment firm and is presently working on computers with a credit card supplier in
  Wellington.
  02> DODGSHUN, Philippa Robyn m on 04.10.1980 to JACKMAN, Peter Heathcote
  b 14.03.1951
  b 01.10.1950
  Philippa b, at Gisborne and m, at Holy Trinity Church, Gisborne. Peter, s/o James David Heathcote
  Jackman and Janet Mary Greacen Black, b. at Gisborne. Address: "Linwood", CI- PDC Waerenga-o-Kuri,
  Gisborne.
  Philippa educated at Woodford House. She worked in the BNZ, Gisborne for 2 years after leaving
  school then spent nearly 4 years in Sydney and two years at Inverell, NSW. She made a short trip to
  Europe in 1971. After returning to New Zealand she groomed polo ponies in Auckland for a season
  then worked as a pedigree compiler for Wrightson Bloodstock in Wellington and Auckland for five
  years. She now works part-time as a merchandiser for Walter Findlay Ltd in Gisborne.
  Peter was educated at Wanganui Collegiate School and graduated BAgCom from Lincoln College.
  Philippa and Peter are now farming in partnership at Waerenga-o-Kuri.
